def parse(indata):
    train = []
    test = []
    ij2k = {(1,1):0,(1,2):1,(2,1):2,(2,2):3}
    for I in [1,2]: # er x-akses separasjon (1) eller abs av matriseelement (2)?
        for mode in ["testing","training"]:
            x = [[],[],[],[]]
            y = [[],[],[],[]]
            for line in indata.split("\n"):
                words = line.split(" ")
                plot_type = words[5]
                if ( plot_type[0] == "y" and  plot_type[1] != str(I) ) or mode != words[0]:
                    continue
                i,j = int(words[2]), int(words[4])
                k = ij2k[(i,j)]
                series = eval(" ".join(words[6:]))
                if plot_type[0] == "y":
                    y[k] = series
                elif plot_type == "x":
                    x[0] = series
                    x[1] = series
                    x[2] = series
                    x[3] = series
                else:
                    raise ValueError("Unknown plot type, got: ", plot_type)
            if mode == "testing":
                test.append( [{"x":x[0],"y":y[0]},{"x":x[1],"y":y[1]},{"x":x[2],"y":y[2]},{"x":x[3],"y":y[3]}] )

            elif mode == "training":
                train.append( [{"x":x[0],"y":y[0]},{"x":x[1],"y":y[1]},{"x":x[2],"y":y[2]},{"x":x[3],"y":y[3]}] )
    return train, test



